sys_variable_value.value:
(function execute(inputs, outputs) {
// Apenas analise o corpo da resposta se o código de status for 200
  if (inputs.status_code == '200'){
// Analisa a variável de entrada response_body e salva o objeto analisado como responseBody
  var responseBody = JSON.parse(inputs.response_body);
// Mapeia os valores responseBody analisados para variáveis de saída
    outputs.hostname = responseBody.hostname;
    outputs.city = responseBody.city;
    outputs.region = responseBody.region;
    outputs.country = responseBody.country;

// divide o local retornado em valores separados de latitude e longitude
    var LocArray = responseBody.loc.split(",");
    outputs.latitude = LocArray[0];
    outputs.longitude = LocArray[1];
  }
})(inputs, outputs);

